INSERT INTO `hub_embeds` VALUES
(1,'main',NULL,'***Step into an unexplored reality and find meaning and hidden truth behind it\'s existence.\n\nAssemble your party and compete with other players, or enter alone. \n\nChoose your class + difficulty level, and experience turn-based combat that challenges your strategy at every turn.***','https://cdn.discordapp.com/attachments/1362832151485354065/1451415058839113828/Hub.png?ex=6946171c&is=6944c59c&hm=5d0af5c0d118aec0d294878b8288823e8ed05b3651f28fad291ea9ae6a910c6b&','**AdventureBot v3.0.9 is now Live!**\n\nYou can view the latest patch notes by joining the Demi Dev Unit Discord: https://discord.gg/EhJ6rZPrNT\n\n:purple_square: **Beta Testers** :purple_square:\n\nPatch 3.1 features have been partially implemented for testing.\nPlease report any bugs or issues on the Demi Dev Unit Discord.',NULL,'2025-03-31 13:43:19'),
(2,'tutorial','Starting A Game','Simply click the **New Game** button to create a new game thread.\n\nThis will add you to the **Queue** system inside the thread, along with anyone else who wants to join.\n\n- Only the players who join the game session will see the private thread and be added to it automatically.\n\n- Up to 6 players can join via the LFG post in the Game Channel by clicking the Join button. \n\n- Additional players will be shown in the **Queue List** in the thread.\n\nWhen the creator is ready they may click **Start Game** to lock in the emount of players playing.','https://cdn.discordapp.com/attachments/1362832151485354065/1373622234865733652/Screenshot_2025-05-18_at_6.14.47_AM.png?ex=682b14e5&is=6829c365&hm=b91a3c24ed88f1f493db9a8f61473923e316e284782ab15bd565f6a82ac25966&','Coming Soon...',1,'2025-04-15 07:50:10'),
(3,'tutorial','Choose Class and Difficulty','Once the Session Creator clicks the Start Game button they can choose their class and difficulty level.\n\n- Selecting **Easy** will generate up to 2 floors with a rare chance to spawn a basement floor. In this mode most harder enemeis are removed from generation.\n\n- Choosing **Medium** difficulty will generate up to 4 floors with at least 2 and a rare chance to spawn a basement. In this mode harder enemies spawn along side easy ones during generation.\n\n- Selecting **Hard** is exactly what you think it is. With up to 4 floors and higher spawn chances on more difficult enemies and less vendor shops and item drops.\n\n- **Crazy Catto** is the most difficult of challenges and well... you\'d be a crazy catto to try it.','https://cdn.discordapp.com/attachments/1362832151485354065/1373622403455778848/Screenshot_2025-05-18_at_6.19.11_AM.png?ex=682b150d&is=6829c38d&hm=045419693ca1ecd758f7ecf5c7208ca4da321622636b908da9e15c99f97dde61&','Coming Soon...',2,'2025-04-17 08:45:05');
INSERT INTO `intro_steps` VALUES
(1,1,'An Unexpected Discovery','During what began as an ordinary raid, Sophia paused. The usual golden glow marking the entrance to familiar realms was absent, replaced instead by a strange portal shimmering with dark, translucent crystals. Curious murmurs rippled through the raid group‚Ä¶\n\nSophia:‚Ä®\"This... isn\'t the gate we\'re used to. Has anyone seen anything like this before?\"','https://cdn.discordapp.com/attachments/1362832151485354065/1383471362823290930/step1.png?ex=6944c95c&is=694377dc&hm=da200c360ef512691349b26ff2de0b3ea5b3c2524e97e4c4495757f01ce955b5&','2025-03-31 07:40:47'),
(2,2,'Mog\'s Bold Venture','As the group hesitated, Mog, the courageous Moogle companion, hovered near the mysterious entrance, eyes wide with intrigue.\n\nMog:‚Ä®\"Let me scout it out, Kupo! Moogles portal hop all the time! If there\'s trouble, I\'ll zip right back!\"\n\nSophia:\n\"Wait! Mog, we don\'t know whats on the other...\"\n\nWithout another word, Mog vanished through the darkened portal.','https://cdn.discordapp.com/attachments/1362832151485354065/1384701702602489856/Step_2.png?ex=6944a5f4&is=69435474&hm=f6e6f7916341cfc663429aa6374ee2a398ff59b1e6b4884d5f740ae52f31b0a7&','2025-03-31 07:40:47'),
(3,3,'The Moogle Returns','Moments felt like hours as the group waited anxiously. Suddenly, Mog burst back through, visibly shaken.\n\nMog:‚Ä®\"It\'s... a labyrinth inside! Dark and scary, I almost got lost and I felt like something was watching me, kupo. We should not enter unprepared.\"','https://cdn.discordapp.com/attachments/1362832151485354065/1451086838453239898/step3.png?ex=6944e56e&is=694393ee&hm=cd458315f668e7e96a7938ed4c9c54aca02946f6abff2a492cef5b6273d23665&','2025-03-31 07:40:47'),
(4,4,'Sophia\'s Decision','Sophia nodded solemnly, her gaze steady yet filled with resolve.\n\nSophia:‚Ä®\"This discovery can\'t be ignored. Whatever lies beyond this portal demands our attention‚Äîbut Mog\'s right. This will require strength, courage, and careful preparation.\"','https://cdn.discordapp.com/attachments/1362832151485354065/1451090272997085271/step4.png?ex=6944e8a1&is=69439721&hm=0192925e2aebed5d7c7ee2061f2915e11390c0772ce55c62e09bbfde43c4998f&','2025-04-09 14:37:27'),
(5,5,'The Call to Adventure','Returning to the Free Company house, Sophia gathered everyone, her voice clear and inspiring.\n\nSophia:‚Ä®\"Friends, we\'ve faced many challenges, but now an unknown labyrinth awaits us. The dangers are uncertain, but the potential rewards‚Äîand truths‚Äîare greater still. Will you join me in unraveling this mystery? Our next journey begins now.\"\n\nYour adventure starts here...','https://cdn.discordapp.com/attachments/1362832151485354065/1451095742214049895/step5.png?ex=6944edb8&is=69439c38&hm=eca08920f7d7823ed8dc33dcaeaaa6f7f104aea92802949c5b1003021fee579f&','2025-04-09 14:37:27');
