INSERT INTO `session_vendor_instances` VALUES
(1,1,2,'Artemecion','__**Artemecion:**__\n\n\"Hey you aren\'t a monster, Kupo! Do you need a **Letter** delivered by chance? \n\nNo? Hmph, well I also sell a few wares I find along my journey, kupo.\"\n\n*Artemecion pauses for a moment, it looks as though he\'s trying to recall something...*\n\n\"Sorry... your face reminds me of **someone I haven\'t seen in a long time**, kupo. I was lost in a good memory for a moment. \n\nFeel free to browse, but my dyes are off limits, kupo!\"','https://cdn.discordapp.com/attachments/1362832151485354065/1376308818199445604/Artemecion.gif?ex=6834daf8&is=68338978&hm=16ecf8b4fff715e695e67f6c647a7dc918bf8cfb0486ac383cb337e22f380efd&','2025-12-19 13:35:25'),
(2,1,1,'Stiltzkin','__**Stiltzkin:**__\n\n**\"Oh hello, I‚Äôm glad to see you are not a monster, kupo! I‚Äôm a traveling merchant, see.. I was portal hopping and suddenly came across a black portal I‚Äôd never seen before...\"**\n\nStiltzkin looks at you as if he‚Äôs trying to recall something. **\"Have we met before, kupo? You seem familiar.\"**\n\n**\"At any rate, if you‚Äôd like to buy or sell something the shop is still open.\"**','https://cdn.discordapp.com/attachments/1362832151485354065/1362946279587713074/stiltzkin.gif?ex=68345ce3&is=68330b63&hm=b99988391998062f540188581a94327b15919d6d620bf7fe8dae6a953e29ba24&','2025-12-19 13:35:25'),
